import React from "react";
class Test2 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  render() {
    return (
      <div>
        The center was founded by Jangsher Singh Gill. on 1st November 1993, GTS
        began as a traditional public affairs firm. As it became evident in the
        mid-1990s that the Internet was transforming the way people interact
        with each other, Gill Telecom Service shifted away from traditional,
        offline public affairs offerings to focus on web-based programs. As an
        early proponent of the Internet as communications platform, GTS is one
        of the few firms with over a 15-year history of achievement in the field
        of online communications.
      </div>
    );
  }
}

export default Test2;
